formation &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 3237 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 1136.00 s &lt;/li&gt;\n&lt;li&gt; transfer time: 350.05 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.11.66:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 8 &lt;/li&gt;\n          &lt;li&gt; Threads: 192 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.35 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport time\nfrom dask_interface import Initialization\nfrom  dask_interface import CoupleDask\nimport numpy as np\nimport pandas as pd\nimport yaml\nimport dask.array as da\nfrom dask.distributed import performance_report\nfrom dask_ml.decomposition import IncrementalPCA\n\n\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Ssize = data[\"parallelism\"][\"height\"]*data[\"parallelism\"][\"width\"]\n    generations = data[\"MaxtimeSteps\"]\n    Sworkers = data[\"workers\"]\n    timeStep = 1\nC = Initialization(Ssize, Sworkers)\nC.client.get_versions(check=True)\n\n\n# Results \nResults = []\n\n# perf holds different time measurements \n# generation, getdata, get-from-queues, computation \nperf = np.empty([generations//timeStep, 4])\nt = time.perf_counter()\n\n\nwith performance_report(filename=\"dask-report.html\"):\n    for g in range(0, generations, timeStep):\n        tic3 = time.perf_counter()\n        tic = time.perf_counter()\n        arrays, perf[g//timeStep][2] = C.get_data()\n        arrays = da.reshape(arrays, (arrays.shape[1],arrays.shape[2])) \n        toc = time.perf_counter()\n        perf[g//timeStep][1] = toc - tic\n        tic1 = time.perf_counter()\n        if g==0:\n            pca=IncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n            pca.fit(arrays)\n        else:\n           pca.partial_fit(arrays)\n\n        arrays=None\n        toc1 = time.perf_counter()\n        perf[g//timeStep][3] = toc1 - tic1  \n        toc3 = time.perf_counter()\n        perf[g//timeStep][0] = toc3 - tic3\n\n\n\nprint(\"pca, \", pca, flush=True)\nResults.append([pca.explained_variance_ , pca.singular_values_])\ntp = time.perf_counter()\nprint(\"Total time to Dask solution is \", tp-t)\n\npperf = pd.DataFrame(perf,columns=['generation', 'getdata', 'getdataq', 'computation'])\npdata = pd.DataFrame(Results,columns=[ 'his', 'bins'])\n\nwith open(\"perf.csv\", \"a\") as fperf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1506","type":"UnionRenderers"},{"attributes":{},"id":"1159","type":"CategoricalScale"},{"attributes":{"callback":{"id":"1138"}},"id":"1139","type":"TapTool"},{"attributes":{"coordinates":null,"formatter":{"id":"1451"},"group":null,"major_label_orientation":-0.3490658503988659,"major_label_policy":{"id":"1452"},"ticker":{"id":"1164"}},"id":"1163","type":"CategoricalAxis"},{"attributes":{},"id":"1507","type":"Selection"},{"attributes":{"coordinates":null,"group":null},"id":"1417","type":"Title"},{"attributes":{"axis":{"id":"1163"},"coordinates":null,"group":null,"ticker":null},"id":"1165","type":"Grid"},{"attributes":{"source":{"id":"1150"}},"id":"1175","type":"CDSView"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth: 265.82 MiB"},"id":"1153","type":"Title"},{"attributes":{"coordinates":null,"group":null},"id":"1415","type":"Title"},{"attributes":{},"id":"1255","type":"LinearScale"},{"attributes":{"axis":{"id":"1259"},"coordinates":null,"group":null,"ticker":null},"id":"1262","type":"Grid"},{"attrib
